CREATE DEFINER=`root`@`localhost` PROCEDURE `stp_get_candidate_share_details`(IN p_entity_id BIGINT)
BEGIN
    -- Drop the temporary table if it exists to avoid conflict
    DROP TEMPORARY TABLE IF EXISTS temp_unique_tickers;

    -- Create the temporary table to hold unique stock tickers for the given entity
    CREATE TEMPORARY TABLE temp_unique_tickers AS
    SELECT DISTINCT s_ticker
    FROM tbl_user_position_details
    WHERE n_entity_id = p_entity_id;

    -- Fetch the matching share details from shareholdings table using LIKE operator, with explicit collation
    SELECT s.candidate, s.share_name, s.amount
    FROM trade_alert.shareholdings s
    INNER JOIN temp_unique_tickers t
    ON s.share_name COLLATE utf8mb4_unicode_ci LIKE CONCAT('%', t.s_ticker COLLATE utf8mb4_unicode_ci, '%')
    OR t.s_ticker COLLATE utf8mb4_unicode_ci LIKE CONCAT('%', s.share_name COLLATE utf8mb4_unicode_ci, '%');

    -- Drop the temporary table to clean up after execution
    DROP TEMPORARY TABLE IF EXISTS temp_unique_tickers;
END ;;
DELIMITER ;
