CREATE DEFINER=`root`@`localhost` PROCEDURE `stp_get_symbol_by_company`(
    IN p_company_search VARCHAR(255)
)
BEGIN
    DECLARE modified_search VARCHAR(255);
    
    -- Normalize the search term by replacing common suffixes
    SET modified_search = LOWER(p_company_search);
    SET modified_search = REPLACE(modified_search, ' ltd.', '');
    SET modified_search = REPLACE(modified_search, ' ltd', '');
    SET modified_search = REPLACE(modified_search, ' limited', '');
    SET modified_search = REPLACE(modified_search, ' lt.', '');  -- Handle "Lt." variation
    SET modified_search = REPLACE(modified_search, ' lt', '');   -- Handle "Lt" variation
    SET modified_search = REPLACE(modified_search, ' pvt', '');  -- Handle "Pvt" for private companies
    SET modified_search = REPLACE(modified_search, ' private', ''); -- Handle "Private" for private companies
    
    SELECT ssymbol_alias
    FROM tbl_symbol_master
    WHERE LOWER(REPLACE(REPLACE(REPLACE(REPLACE(REPLACE(REPLACE(REPLACE(scompany, ' ltd.', ''), ' ltd', ''), ' limited', ''), ' lt.', ''), ' lt', ''), ' pvt', ''), ' private', ''))
    LIKE CONCAT('%', modified_search, '%')
    LIMIT 1;
END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
/*!50003 SET character_set_results = @saved_cs_results */ ;
/*!50003 SET collation_connection  = @saved_col_connection */ ;
