CREATE DEFINER=`root`@`localhost` PROCEDURE `stp_subtract_shares_mf`(IN p_co_code BIGINT)
BEGIN
    DECLARE highest_day_id BIGINT;
    DECLARE previous_day_id BIGINT;
    DECLARE highest_day_shares DOUBLE;
    DECLARE previous_day_shares DOUBLE;
    DECLARE shares_difference DOUBLE;

    -- Get the highest day id for the given co_code
    SELECT MAX(nday_id)
    INTO highest_day_id
    FROM tbl_mf_holdings_increment_decrement
    WHERE co_code = p_co_code;

    -- Calculate the previous day id (highest day id - 1)
    SET previous_day_id = highest_day_id - 1;

    -- Get the total shares for the highest day id
    SELECT dtotal_chares
    INTO highest_day_shares
    FROM tbl_mf_holdings_increment_decrement
    WHERE co_code = p_co_code AND nday_id = highest_day_id;

    -- Get the total shares for the previous day id (highest day id - 1)
    SELECT dtotal_chares
    INTO previous_day_shares
    FROM tbl_mf_holdings_increment_decrement
    WHERE co_code = p_co_code AND nday_id = previous_day_id;

    -- Subtract the shares
    SET shares_difference = highest_day_shares - previous_day_shares;

    -- Output the result
    SELECT shares_difference AS share_difference;
END ;;
DELIMITER ;
